// myComponent.js
import React from 'react';
import BubbleUI from "react-bubble-ui";
import "react-bubble-ui/dist/index.css";


export default function myComponent(props) {
	const options = {
		size: 180,
		minSize: 20,
		gutter: 8,
		provideProps: true,
		numCols: 6,
		fringeWidth: 160,
		yRadius: 130,
		xRadius: 220,
		cornerRadius: 50,
		showGuides: false,
		compact: true,
		gravitation: 5
	}



	return (<BubbleUI options={options} className="myBubbleUI">
		<h1>mouse</h1>
	</BubbleUI>)
};
